    const [keyword, setKeywrod] = useState("wellness");

    return (
        <div className="dashboard">
            <div className="Widgets">
                <FeaturdInfo />
            </div>
            <div classname="chart-container">
                <input 
                  type="text"
                  placeholder="키워드 입력"

                />

            </div>

                    <Chart 
                        data={userData}
                        title="월별 검색량"
                        grid
                        dataKey="Active User"
                    />
            <div className="row">
                <WidgetSm />
                <WidgetLg />
            </div>
            <div className="col">
                <WidgetCol />
            </div>
        </div>
    )
}
